危険物（ガソリン・軽油等）の運搬・短期保管に！<br>国内認証取得！消防法適合品<br><br><br>■トラクター・耕運機や草刈機等の農機具用に<br>■重機や原付用に<br>■キャンプ等のレジャーやボート用に<br>■底面にくぼみが付いているので注ぎやすい！<br><br><br>※ポリ容器でのガソリンの持ち運び・保管は消防法で禁止されています。<br><br><br>【仕様】<br>容量：10L<br>本体：冷間圧延鋼板<br>キャップ：アルミダイキャスト<br>ノズル・締付部：PE<br>塗装：粉体塗装<br>鋼板の厚み：0.8mm<br>本体サイズ：約402(W)×195(H)×251(D)mm<br>重さ：約2.0kg（ノズル含む）<br><br>メーカー：大自工業/Meltec<br>品番：FG-10<style type="text/css">
