マニュアル車・オートマ車（シフトボタン無）とも使用できるタイプです。<br>
付属のアダプターを使用するとシャフト径が10mmのお車に取り付けることができます。<br>
オーバードライブ・４WDスイッチ付のシフトノブ、または外車には取付できません。 <br><br>

